import React, { useState, useRef, useEffect } from "react";
import styled from "styled-components";
import axios from "axios";
import "../style/NewUserFloat.css";
import ReactDOM from "react-dom";
import Picker from "react-mobile-picker-scroll";
import mini1 from "../img/NewUserFloat_img/mini1.png";
import mini2 from "../img/NewUserFloat_img/mini2.png";
<script src="https://cdn.jsdelivr.net/npm/axios/dist/axios.min.js"></script>;



function NewUserFloat() {
    const BackgroundWrap = styled.div`
    background: #FEFAEF;
    `;
    const Background = styled.div`
    height: calc(var(--vh, 1vh) * 100);
    max-width: 37.5rem;
    margin: 0px auto;
    display: flex;
    flex-direction: column;
    background: #FEFAEF;
    `;
    const HeaderWrap = styled.div`
    height: 10%;
    justify-content: center;
    align-item: center;
    display: flex;
    `;
    const Header = styled.div`
    display: flex;
    height: 50%;
    width: 100%;
    margin: auto;
    flex-direction: row;
    justify-content: space-around;
    `;
    const HeaderIcon = styled.div`
    width: 15%;
    justify-content: center;
    align-item: center;
    display: flex;
    `;
    const LogoWrap = styled.div`
    justify-content: center;
    align-item: center;
    display: flex;
    width: 70%;
    `;
    const Logo = styled.div`
    margin: auto;
    `;

    const style = {
    margin: "auto",
    };



    const handleButtonClick = () => {
        window.location.href = 'http://localhost:3000/initial';
    };

  
    return (
      <BackgroundWrap><Background>
        <div className="l1-4">
            <p>FACETICKER</p>
        </div>
        <div className="l2-4">
            <p>나만의 페이스티커를 통해 자신을 표현하고 친구들에게 궁금한 점을 묻고 답하며 자유롭게 소통해보세요.</p>
        </div>
        <div>
            <div className="l3-4" style={{float:'left'}}>
                <img  className='l3-4' src={mini1}></img>
            </div>
            <div className="l4-4" style={{float:'left'}}>
                <img  className='l4-4' src={mini2}></img>
            </div>
        </div>
            <div className="l6-4">
        </div>
        <div>
            <button className="l5-4" onClick={handleButtonClick}>
                <p>시작하기</p>
            </button>
        </div>
      </Background></BackgroundWrap>
    );
  }
  
export default NewUserFloat;
